// src/store/actions/authActions.ts
export const LOGIN_REQUEST = "LOGIN_REQUEST";
export const LOGIN_SUCCESS = "LOGIN_SUCCESS";
export const LOGIN_FAILURE = "LOGIN_FAILURE";
export const LOGOUT = "LOGOUT";

export const loginRequest = (data: { email: string; password: string }) => ({
  type: LOGIN_REQUEST,
  payload: data,
});

export const loginSuccess = (user: any) => ({
  type: LOGIN_SUCCESS,
  payload: user,
});

export const loginFailure = (error: string, attempts: number) => ({
  type: LOGIN_FAILURE,
  payload: { error, attempts },
});

export const logout = () => ({
  type: LOGOUT,
});


const action = {
    type: 'LOGIN',
    loginRequest: { email: 'test@example.com', password: 'password123' },  // Directly initialize here
  };
